function Sensible(e){this.render(e)}Sensible.prototype.render=function(e){e.querySelectorAll(".sensible").forEach((e,s)=>{e.addEventListener("click",(function(){e.querySelectorAll("img").forEach((e,s)=>{e.classList.contains("hidden-sensible")?e.classList.remove("hidden-sensible"):e.classList.add("hidden-sensible")})}))})};